package org.dx4.external.persistence;

public class Prize {

	private char place;
	private double prize;
	
	public Prize()
	{
	}

	public char getPlace() {
		return place;
	}

	public void setPlace(char place) {
		this.place = place;
	}

	public double getPrize() {
		return prize;
	}

	public void setPrize(double prize) {
		this.prize = prize;
	}
	
	
}
